      <Grid container spacing={5}>
        <Grid container item xs={12} spacing={3}>
          <ContainedButtons></ContainedButtons>
        </Grid>

        <Grid container item xs={12} spacing={3}>
          <CustomizedInputs></CustomizedInputs>
        </Grid>
      </Grid>
    </>
  );
}

export default Form;

